    -- Select All Events That Arent in Post Postgress
    SELECT record_id
    FROM postgresIds
    WHERE record_id NOT IN (SELECT record_id FROM stageEvents)
    -- AND VERSION NOT IN (SELECT version FROM deletedPostgresIds)
    ORDER BY record_id DESC
)
